import React from 'react';
import './Project.css';
import Card from './Card';
import img1 from '../../images/p-1.png';
import img2 from '../../images/p-2.png';
import img3 from '../../images/p-3.png';
import img4 from '../../images/p-4.png';
import img5 from '../../images/p-5.png';
export default function Project(){

    const title=["Typing-Test","Random_Quotes","Conference-Page","Basic-Calculator","Notes-App","Wheather-App","App_in_production"];
    const des=[" This is a Typing Test game where you can get your typing speed and accuracy ",
            "This is a Random Quotes Generator . It generates Random Quotes on button click",
           "This is a well Designed Conference page website to host any meetings or conferences ",
           "This ia a Basic Calculator App which can perform basic operations  nicely",
        "This is a notes app which has all the basic functionalites to keep their imortant notes"]
    
    return(
        <>
          <div className="panel p" id='p'>
             <h2 className="p-title"> Recent Projects</h2>
             <div className="p-menu">
                 <div className="h-c-js" id='p-1' onClick={()=>{
                      document.getElementById("p-1").style.backgroundColor="rgb(2,2,66)";
                      document.getElementById("p-1").style.color="#fff";
                      document.getElementById("p-2").style.backgroundColor="#fff";
                      document.getElementById("p-2").style.color="black";
                      document.getElementById("p-3").style.backgroundColor="#fff";
                      document.getElementById("p-3").style.color="black";
                      document.getElementById("p-p").style.left="0vw";
                      document.getElementById("p-rp").style.left="-100vw";
                      document.getElementById("p-bp").style.left="100vw";
                 }}>
                     HTML|CSS|JS
                 </div>
                 <div className="react" id='p-2' onClick={()=>{
                      document.getElementById("p-2").style.backgroundColor="rgb(2,2,66)";
                      document.getElementById("p-2").style.color="#fff";
                      document.getElementById("p-1").style.backgroundColor="#fff";
                      document.getElementById("p-1").style.color="black";
                      document.getElementById("p-3").style.backgroundColor="#fff";
                      document.getElementById("p-3").style.color="black";
                      document.getElementById("p-p").style.left="-100vw";
                      document.getElementById("p-rp").style.left="00vw";
                      document.getElementById("p-bp").style.left="100vw";
                 }}>
                     React
                 </div>
                 <div className="node" id='p-3' onClick={()=>{
                      document.getElementById("p-3").style.backgroundColor="rgb(2,2,66)";
                      document.getElementById("p-3").style.color="#fff";
                      document.getElementById("p-2").style.backgroundColor="#fff";
                      document.getElementById("p-2").style.color="black";
                      document.getElementById("p-1").style.backgroundColor="#fff";
                      document.getElementById("p-1").style.color="black";
                      document.getElementById("p-p").style.left="-100vw";
                      document.getElementById("p-rp").style.left="100vw";
                      document.getElementById("p-bp").style.left="00vw";
                 }}>
                     Node|MdB
                 </div>
              </div>
              <div className="p-p" id='p-p'>
                  <Card image={img1} title={title[0]} des={des[0]}/>
                  <Card image={img2} title={title[1]} des={des[1]}/>
                  <Card image={img3} title={title[2]} des={des[2]}/>
              </div>
              <div className="p-rp" id='p-rp'>
                   <Card image={img4} title={title[3]} des={des[3]}/>
                   <Card image={img5}  title={title[4]} des={des[4]}/>
              </div>
              <div className="p-bp" id='p-bp'>
                    <Card />
                    <Card />
              </div>
          </div>
        </>
    )
}
